                          </button>
                        </div>
                        ) : mediaItem.type._text.startsWith('video') ? (
                        <div>
                          <video controls className="video-container">
                            <source src={`data:${mediaItem.type._text};base64,${mediaItem.data._text}`} type={mediaItem.type._text} />
